\n● 柔軟舒適 呵護毛孩\n● 環保耐磨 提供舒適體驗\n● 插扣設計 安全更加倍'),
(217, '牛仔百褶裙', 83, 44, 1400, '2022AW牛仔系列因人氣而增加！\n上次立即售罄的商品又恢復了庫存。\n這個項目肯定會提高本季引人注目的牛仔風格的新鮮度。――通過將休閒的牛仔材料\n打褶 搭配 T 恤的造型不會太隨意，大人也可以穿上它。還建議在搭配牛仔襯衫的設置中添加金色配飾。'),
(218, '牛仔工字裙', 12, 44, 1280, '越穿越合身的材質柔軟而魅力十足的牛仔裙。\n它使用與 Denim Slim Tapered 相同的材料。\n[設計]\n不分潮流都可以使用的I字型廓形，中央開衩增加了自由感和行動自如的感覺。\n後袋還具有使臀部顯得高的平衡感，並且長度較長，適合任何鞋子。\n化學黑和米色本季新鮮♪'),
(219, '格紋美人魚裙', 12, 44, 890, '【材質】\nTR彈力材質，可穿多季。\nGLOBAL WORK 獨創的格子圖案搭配時尚的秋季色彩組合。\n[設計]\n魚尾裙搭配垂直切換，打造利落廓形。\n腰線不挑，廓形也不會太寬，給人一種成熟的印象，\n粗腰帶讓腰部看起來更高，提升你的風格。\n腰部後部由橡膠製成，易於穿脫。'),
(220, '2段百褶裙', 84, 44, 2300, '的兩層風琴褶時尚裙子 兩層精美風琴褶設計的裙子。 \n輪廓不太寬，並且具有時尚的外觀。 \n腰部飾有彩色羅緞帶。[造型] \n搭配簡單的 T 卹或針織衫，打造引人注目的裙子。 \n為了你的腳，穿上優雅的平底鞋和高跟涼鞋，打造女性化外觀！'),
(221, '褶皺裙', 14, 44, 1380, '◆細節◆\n腰部有彈性，無壓力，是一條帶有大量褶襉和褶皺的戲劇性裙子。\n下擺處充滿奢華感和豐盈感的裙子是任何人都可以輕鬆看起來時尚的單品。\n穿著輕便舒適，從初秋開始，夏天的炎熱揮之不去，它肯定會派上用場。\n◆ FABRIC point ◆\n由100% 再生尼龍製成的環保材料。\n一條非常輕盈舒適的縮褶裙，具有尼龍所不具備的自然質感。'),
(222, '長方形帽子', 83, 46, 890, '一頂簡單的長方形帽子，很容易與你的衣服搭配。\n因為帽簷比平時長，所以也是運動或外出時防曬的理想選擇。\n[NEW ERA/New Era]\n自1920年成立以來，作為世界上最好的頭飾公司，它一直在快速發展。它是一種能夠充分錶達每個人的個性和風格，超越時間、文化、運動和時尚的頭飾。'),
(223, 'NEWERA 遮陽板', 83, 46, 1400, '易於搭配運動裝的簡單遮陽板是運動時防曬的理想選擇。\n用粘扣帶可以調整尺寸。\n關鍵是吸汗帶使用的是觸感舒適的絨面面料。\n[NEW ERA/New Era]\n自1920年成立以來，作為世界上最好的頭飾公司，它一直在快速發展。它是一種能夠充分錶達每個人的個性和風格，超越時間、文化、運動和時尚的頭飾。'),
(224, '原創針織漁夫帽', 13, 46, 1380, '經典單品是針織材質的漁夫帽，手感和保暖度不一樣。\n這是一種易於與您永遠不會厭倦的基本形式相匹配的設計。--漁夫帽 Bakeha Knit'),
(225, '原創刺繡帽', 13, 46, 1240, '每個季節都流行的簡單標誌帽，採用羊毛混紡材料，增強了季節感。 \n有 2 種類型可供選擇：易於搭配的純色，以及將成為您服裝焦點的配色方案。 \n材質的質感表現出秋天的感覺，徽標刺繡實現立體效果。 \n你可以選擇你喜歡的顏色來搭配你的衣服。'),
(226, '原創飛行員式帽子', 13, 46, 1500, '一款飛行風格的帽子，採用抓絨材料和圍著耳朵的圍巾，適合秋冬的休閒風格。 \n該設計易於使用，給人一種隨意的印象，同時保持熱量。 \n提供 3 種易於日常使用的顏色，它將在許多方面有用。 \n■Nikologo 登山扣 \n附帶的登山扣是用於配件的。請勿用於牽引等關節。請勿施加過大的力、衝擊或重載。ーーCap Hat Boa Niko Logo Carabiner'),
(227, '原創混色披肩', 13, 47, 1100, '一款簡單的披肩，顏色和質地都很柔和。\n混色般的色彩對比營造出立體效果，給人一種溫和的印象。\n這是一個可以在各種場景中使用的項目。'),
(228, '蟒蛇兜帽的圍巾', 13, 47, 1080, '蟒蛇裸色連帽設計旨在抵禦寒冷並突出您的裝束。 \n蟒蛇皮材料使用再生聚酯纖維。 \n■Nikologo 登山扣 \n附帶的登山扣是用於配件的。請勿用於牽引等關節。請勿施加過大的力、衝擊或重載。'),
(229, '原創羅紋針織多頭圍巾', 13, 47, 1600, '#Nico Acty Club \n秋冬休閒風格 \n蟒蛇裸色連帽設計旨在抵禦寒冷並突出您的裝束。 \n蟒蛇皮材料使用再生聚酯纖維。'),
(230, '羊絨觸感/雙面圍巾', 85, 47, 2500, '一條帶有羊絨觸感的圍巾，正反面用不同的顏色改變印象！ \n有精緻的體積感，很漂亮，可以搭配任何休閒單品。 \n它是一款多功能的消聲器，不僅可以用於厚外套，還可以用於西裝等商務場景。 \n它也可以用作投擲物或毯子。'),
(231, '復古玻璃圍巾', 85, 47, 1450, '具有復古感的複古圖案圍巾現已上市。 \n作為軍事工作和舊衣服等休閒造型的重音！ \n現在二手衣服正在流行，圍巾迅速流行，是您想要融入日常造型的物品。'),
(232, 'Nike Air Max 90', 13, 48, 3500, '耐穿舒適，\n深受喜愛的 90 年代風格\nNike Air Max 90 是經典的輕質舒適鞋款。\n它以熟悉的華夫格鞋底、縫合覆蓋層和經典的 TPU 口音不辜負它的根源。\n清新的細節賦予它現代外觀，而 Max Air 緩震系統讓您全天保持舒適。'),
(233, '原創有機棉 Nico Logo 純色運動鞋', 13, 48, 3000, '流行的 Nikologo 便鞋採用可持續材料製成！\n從 2021SS 開始出現的套穿式素色運動鞋已經更新了改變的材料。\n我們使用可持續材料，例如無氟防水有機棉。\n鞋墊使用抗菌除臭材料 Bacte Shut，以防止令人不快的氣味和細菌。\n正面很休閒，鞋墊有一個大而流行的Nico標誌。\n這是一雙可以毫無壓力地穿著，易於日常使用，讓外出變得有趣。'),
(234, '原創輕量厚底長靴', 13, 48, 4500, '這款長靴穿著舒適，採用輕質厚底，柔軟舒適，這種寬大的感覺和輕質低迴彈海綿鞋墊。 \n無論搭配什麼，都能長時間穿著的秋冬基本款。 \n低迴彈的海綿鞋墊，腳感很好，日常使用似乎也很有用。 \n關鍵是它配有流行的抗菌除臭膠帶並使用可持續材料。'),
(235, '交叉帶涼鞋', 13, 48, 2100, '這款涼鞋穿著非常舒適，厚實的緩衝鞋底 \n強調輕盈和緩衝，讓您不會感到疲倦。 \n隨意粗細的肩帶和寬大的鞋底給人一種成熟活躍的感覺。 \n我們還有一個雙色設計，有很多存在感，非常適合強調你的腳。'),
(236, 'Samami Eco Court 運動鞋', 12, 48, 3200, '這款運動鞋採用與LIGHT TECH 系列相同的彈性材料，\n具有輕便、功能性鞋墊、抗菌除臭和防水等特點。\n同樣，它重量輕，並且具有對您的腳溫和的規格。\n造型：\n易於搭配辦公室休閒裝\n，運動鞋中常見的輕薄休閒感，穿起來就像穿皮鞋一樣。'),
(237, '圖案領帶', 85, 49, 1200, '具有令人印象深刻的圖案的領帶。\n它也可以用作與襯衫協調的強調色。\n它很適合搭配休閒裝和正式場合。\n好的一點是，無論季節如何，它都可以在各種情況下使用。'),
(238, '條紋領帶', 85, 49, 1080, '一條期待已久的領帶出現在當前熱潮中的二手衣服。\n重點是團紋，光澤適中！\n這種設計不僅可以用於日常使用，還可以用於正式場合。'),
(239, 'Rocky 手工縫製 紳士領結', 87, 49, 800, '英倫風格男士領結，取自義大利進口植鞣牛皮 Rocky 皮革， 全手工裁切、塑形、縫製，可客製印上英文專屬名字，擁有溫潤的手感，”頸“上添花！'),
(240, '英式特殊款領結 Bowtie 紳士/商務/婚禮', 88, 49, 1600, '三層面料、質地立挺，為至尊一整天的美麗和時尚而設計。\n義大利設計的特殊面料，令人驚豔的質感，勝任您所需要的場合。\n寬度大小適中，適合各種臉型與場合，每個稜角、弧度都是Cinlax的心血。\n就是希望任何人都可以輕易搭配，一起感受截然不同的手工領結。'),
(241, '獨特氣息 Premium系列領帶 Neckties', 89, 49, 1700, '自然色系 搭配不安定的氣息 \n看似基本款 \n卻是獨樹一格的絕選'),
(242, '淡靄藍天絲床包四件組', 86, 77, 3480, '天絲纖維有絕佳的親水性、吸濕性，具有透氣涼爽的功能。\n隨環境氣候變化，快速釋放濕氣，極佳的濕度調控，\n達到減少細菌生長的效果，非常適合作為床套的材質。\n舒柔親膚夏季最好的床寢良伴，交給百分百天絲製成的床包被套吧！\n溫和不強烈的淡靄色，讓喜歡穩定平和色澤的你，可以舒適的躺在床上！'),
(243, '日安貓貓刮泥入門墊', 86, 77, 490, '絲圈刮泥材質避免髒污進入屋內，\n可愛實用兼具、每天進門都療癒到不行，特製防滑膠底，使用安全無虞。'),
(244, '日系慢活厚棉線編織大地毯', 90, 77, 1780, '●天然厚實的觸感\n●簡約的配色\n●材質柔軟堅固耐用\n●可水洗，清潔容易'),
(245, '可機洗純棉手工地毯 玫瑰褐', 91, 77, 4580, '選用棉質天然布料手工製作，染料及製程遵守歐洲無毒規定，\n不含有毒染料、無添加刺激性化學物質，同時每一塊地毯皆由印度工匠親手編織，\n不僅擁有獨一無二的特色且十分柔軟，帶給雙腳最柔軟舒適的感受。'),
(246, 'OYOY Kyoto 簡約點點長型抱枕', 92, 77, 1500, 'Kyoto 有機棉抱枕系列，100%有機純棉製成，面料親膚舒適，復古格紋外觀豐富視覺上的明亮，同時為家中帶來沉穩感，延續居家空間整體的品味'),
(247, '巧克餅乾四層置物架', 93, 78, 2350, '俐落工業風格收納層架，大容量開放式置物，如夾心餅乾外型的深木紋層板，無需工具轉動即可組裝。\n以 PANTONE 432C 質感灰色，跳脫非黑即白的選色，外銷法國獨家限定霧灰色；讓每日的收納置放，成為獨一無二的存在。'),
(248, '北歐風A型摺疊吊衣架', 93, 78, 1680, '北歐風配色掛衣架，活動式MDF可摺疊設計，輕鬆收納。\n一本書、一雙皮鞋、一件羊毛衫，那些日常生活中，與你相伴的物件帶著記憶也蘊藏著生活中的體會。LIGFE 於自然流露的質地溫度裡，將每一天的居家收納，化為簡單又舒適的生活品味。'),
(249, '緩降靜音簡約方型', 93, 78, 1200, '質感霧灰色烤漆垃圾桶，緩降式靜音上蓋，10L大容量，耐用鐵製材質；可拆式內桶方便清洗，踏式開關免用手開。'),
(250, '雙層珪藻土置物架', 93, 78, 1070, '使用質感霧灰色烤漆，搭配自動吸水珪藻土設計，雙層收納空間，廚房、浴室小物收納皆適用。\n以 PANTONE 432C 質感灰色，跳脫非黑即白的選色，外銷法國獨家限定霧灰色；讓每日的收納置放，成為獨一無二的存在'),
(251, 'PET 抽屜分隔／鏡櫃用可層疊收納盒', 94, 78, 500, '．整齊分類收納抽屜內的零散小物\n．深度約 8.5cm，可放置於鏡櫃內\n．不同款可層疊，桌面整潔省空間\n．三種尺寸可挑選，自由組合搭配'),
(252, '小王子造型星球燈-愛與馴養', 95, 79, 1680, '以 Type C 充電使用，隨盒附有充電線（能調校 2 級亮度）\nVIPO致力於國際品牌產品的創新設計，匠心製造和全渠道營銷。\n所經營產品包含各類兼具藝術性和實用性的生活美學產品，從而滿足現代人們對美好生活的嚮往。'),
(253, '匠心花藝清新居家乾燥花藝組', 96, 79, 990, '★匠心獨到設計花藝花束\n★靜謐晶透工藝花瓶\n◆設計師等級花藝配置\n◆生活多點自然元素打造隨興愜意\n◆送人、犒賞自己都心意十足\n◆適合居家、辦公佈置，精緻又典雅'),
(254, '藝術版畫 Serene Stripes', 97, 79, 1960, '匯集斯堪地的生活模式、文化根基和室內設計趨勢作為靈感，無論是知名或新進創作者，The Poster Club 不斷吸納各種風格的創作，將之轉印成高品質的藝術印刷品。希望成為藝術家與大眾之間的橋樑，讓藝術對於個人再也不是遙不可及。'),
(255, '永恆燭台 Twilight 玫瑰金色', 98, 79, 1680, '1. 金屬滅燭蓋熄滅燭火後，能夠延續燭火意象，作為室內擺飾。\n2. 金屬曲面滅燭蓋可透過光源反射，在牆上投射出耀眼光芒，恆久存在。\n3. 燭杯內徑4.8cm、深度2.4cm，市面上Tea Light尺寸的小蠟燭皆適用。\n4. 錐狀玻璃杯罩可供正反面擺放，呈現兩種不同造型。\n5. 戶外使用時錐狀玻璃杯罩有防風功能，使燭火不易熄滅。'),
(256, '珊瑚鹿角 大理石飾品架', 99, 79, 1380, '外形猶如珊瑚的樣貌，延伸的設計也像是鹿角一般的延展，把自然的藝術落入設計中，光芒內斂般的存在。飾品架可以吊掛項鍊、手鍊、耳機線等飾品，底部收納盤也可以擺放戒指、耳環或一些小物，兼具收納及展示的獨特飾品架，也可作為家中一只簡約的藝術品。'),
(257, '超省力無線電動拖把', 100, 80, 1690, '1. USB充電，60分超強續航力。\n2. 雙渦輪引擎，高速旋轉去汙。\n3. 二段收納桿，輕鬆收納不占空間。\n4. 超薄機體設計，易深入清潔狹窄空隙。'),
(258, '電解水碗盤清潔液', 101, 80, 580, '重油濃醬、殘色奶臭 輕鬆洗淨不傷手\n\n．鹼性離子有效皂化油汙，加倍清潔\n．有效洗去食物殘色，潔淨不留痕\n．去除異味超有感，奶垢、魚腥不殘留\n．抗菌率達99.9%，真正有效潔淨\n．不含磷、螢光劑、三氯沙等有害物質，安心力大提升\n．台灣研發製造'),
(259, '天然無毒 復古鐵盒洗衣粉', 102, 80, 650, '✔ 成份天然：不含磷酸鹽等有毒物質、人工香精和刺激性起泡劑，大人小孩都適用\n✔ 綠色環保：所有的商品都可生物分解，確保在洗衣的過程中沒有其他有毒物質排入環境\n✔ 高效能且不損害洗衣機：為 HE 高效能濃縮，也適用滾筒洗衣機，不含多餘填充物質，低用量即可將衣服清洗乾淨\n✔ 快速溶解不殘留：洗衣粉可於水中快速溶解，不會殘留於衣物或堵塞洗衣機管道'),
(260, '生活工作所 拋棄式馬桶刷清潔組', 103, 80, 420, '·邊邊角角皆能輕鬆清潔的刷柄\n·不需另外使用清潔用品的清潔劑刷頭\n·能直接沖進馬桶的拋棄式刷頭\n·肉肉眼看不到的細菌也清潔乾、淨殺菌力99.9%\n·肌膚刺激性測試完成安全性'),
(261, '貓掌全自動感應泡沫機', 104, 80, 790, '體積小巧，免安裝即可使用。\n300ML大容量，免頻繁加水。\nIPX4級防水，告別浸水故障。\n超萌貓掌造型，洗手也很療癒。\n長效充電，可連續使用約30天。'),
(262, 'Flowerpot VP1 小型吊燈 霧黑', 105, 81, 10500, '由丹麥設計大師 Verner Panton 於 1968 年設計，色彩鮮明、帶有圓形吊墜懸掛在半圓頂燈罩上，Flowerpot 系列充份體現了 Verner Panton 的實驗態度。時至今日，仍被視為無可取代的經典設計。'),
(263, 'MASON 金屬咖啡桌', 106, 81, 6330, '將現代新穎的時髦帶進空間，感受異材質搭配，於細節裡體現工藝恆美的價值，無論是客廳或是辦公室，你都會需要一張這樣質感設計咖啡桌。'),
(264, 'JOLIEN 扶手單椅', 106, 81, 6330, '用現代感十足的元素打造摩登起居，以極簡主義訴說素雅與不凡品味，老派中盡顯經典姿態，如同一座充滿歷史的莊嚴古城，步伐踩踏之間滿是懷舊的渴慕。'),
(265, 'POLLY TEDDY 摩登雙人沙發', 106, 81, 28200, '以斯堪地那維亞的極簡設計，無須多餘的線條，僅需色彩來調柔空間，抹入一道品味優雅的象牙白色，鋪陳居家質感；堅固黑鐵椅腳，為潔淨的白增添視覺上的品味層次。'),
(266, 'Rosen 藤編休閒椅', 99, 81, 19800, '休息日裡，習得一方自然的專屬座椅。\n藤編的調性，除了是清爽、清新、悠閒、度假等形容，其實還有種寧靜的朦朧美感，交織的密度格線總可以恰到好處的交錯，Rosen 藤編休閒椅有著丹麥熱愛的有幾外觀，寬廣的椅背適合讓身體傾靠休息，整體的曲線設計優美自然，呈現了完全不同的氣質，注入了不一樣的能量。\n舒適的、放鬆的，在工作家事之餘，享受一杯茶的沈澱時光。\n'),
(267, '【礁溪川湯春天旗艦館】雙人早晚餐或四人家庭房含早餐', 107, 59, 5999, '【費用包含】\n1.礁溪川湯旗艦館平日入住二選一：\nA.春天雙人客房住宿一晚(含2人早餐+晚餐) 或\nB.春天家庭客房住宿一晚(含4人早餐)\n2.飯店設施免費使用:SPA按摩池/風呂設施/檜木烤箱/•蒸氣室/顏之泉/石板床/兒童戲水區/CARS卡茲童樂園/卡茲童賽車場/健身房...等\n3.免費停車.飯店至礁溪火車站/礁溪轉運站免費接駁(提前預約)\n4.120公分以下兒童不佔床免費,限2名\n\n【其他注意事項】\n1.優惠期限至:無使用期限\n2.不適用日期:農曆春節期間(依飯店公告為主)不適用\n3.持券選擇平日入住春天家庭房,欲升等童樂主題房每房需加收650元,平原景觀房加價800元'),
(268, '【墾丁怡灣渡假酒店】雙人入住菁英客房一泊一食(含三合一設施券)', 108, 59, 3100, '【專案包含】\n1. 入住菁英客房一晚\n2. 0-6歲免費入住\n3.含早餐\n4.含三合一設施券'),
(269, '【遠雄悅來大飯店】超級快閃!海洋篇★買2大送1小11歲、含早餐+遠雄海洋公園門票', 109, 59, 6999, '◆本券可兌換方案:【遠雄悅來大飯店】99狂購節超級快閃!海洋篇★買2大送1小11歲、含早餐+遠雄海洋公園門票\n◆本券可兌換方案：\n1. 平日入住「精緻山景客房」住宿*1晚，含翌日早餐2客、含遠雄海洋公園門票2張(限定住宿期間暢遊)。\n(床型依照入住人數安排、或有特殊需求請致電向飯店訂房組需求，需求不保證)\n2.特別加贈1位11歲(含.以下)孩童入住，免加人加價，並贈送翌日早餐1客、含遠雄海洋公園門票1張(限定住宿期間暢遊)。\n若不使用此贈送，恕無法折抵任何金額及商品。\n3.由「精緻山景客房」升等「豪華海景客房」＋$650/間/晚，可於訂房時需求，於飯店現場支付房差費用。\n'),
(270, '【溪頭明山妖怪村主題飯店】枯麻/百老匯館雙人含早餐', 110, 59, 3099, '【費用包含】\n1、住宿：枯麻館或百老匯館-主題二人房-平日住宿1晚(二大床/約12坪，館別與房間依飯店實際安排 為主，無法指定。密室逃脫房與特殊房型不適用)。\n2、餐食：中西式自助早餐2客。\n3、票券：日月潭和果森林紅茶莊園體驗券2張(紅茶試喝/茶包兌換/消費優惠)、埔里豐年菇類農場體驗券2張(導覽解說/消費優惠)，於飯店領券。\n4、設施：停車場(房客免費)、妖怪園區(免門票)、兒童遊戲室、乾溼分離衛浴、RO逆滲透山泉水、WiFi…等。'),
(271, '【瑞穗天合國際觀光酒店】平旺日城堡精緻客房雙人一泊二食住宿卷1張', 111, 59, 12300, '此為紙卷\n※商品到貨享十天猶豫期之權益（注意！猶豫期非試用期），商品退貨時必須回復原狀，\n票券若已拆封有短缺、損毀或贈品已逾期、使用效期快到(廠商定義)等，本公司無法接受退換貨。\n※超過鑑賞期退票需收手續費(面額金額*3%)(無面額依銷售金額*3%)，請購買前三思。'),
(272, '【南投埔里-歐莉葉荷城堡】2人平日住宿券', 112, 60, 4500, '使用方式:\n1.本券可2人入住歐莉葉荷城堡以下房型(擇1)乙晚，不含早餐。\n維多利亞城堡：仙度拉公主/ 愛麗絲公主\n伊莉莎白城堡Ⅱ：芳堤娜公爵夫人\n※因各房型僅有乙間，入住以現場房況為主，恕無法指定房型。\n2.本券限平日(週日~週四)使用，假日(週五、週六) 需加價$1000，農曆春節期間和連續假期不得使用。(平、假日及暑假定義依飯店公告為主)\n3.本券須提前7天前完成預約，預約電話：(049)2993636，預約時間為08:30~17:30。電話訂房時需預付訂金$1000，入住時全額還款，或選擇加LINE訂房，LINE ID:0492993636\n4.如欲升等房型使用須於現場加價使用。每房最多加1人(含兒童)。每位成人加價$1500/房(無早餐及備品，無提供加床服務)，每位兒童加價$500/房(無早餐及備品，無提供加床服務)。成人定義：140公分以上視同成人，未滿140公分為兒童。\n5.本券入住時間：15:00;退房時間：隔日11:00以前。\n6.本券恕無法與其他優惠及專案合併使用。'),
(273, '【清境福爾摩莎時尚會館】精緻浪漫雙人房含早-買1晚送1晚(送合歡山/大禹嶺高山茶包)', 113, 60, 5199, '【費用包含】\n1、住宿：精緻浪漫雙人房-平日住宿1晚(1大床/約9坪)。\n2、餐食：中式自助早餐2客。\n3、票券：埔里豐年菇類農場體驗券2張(導覽解說/消費優惠)、日月潭和果森林紅茶莊園體驗券2張(茶包兌換/消費優惠)，於民宿領券。\n4、設施：免費停車場、泡茶區…等。'),
(274, '【墾丁优閒民宿】四人家庭房三天兩夜含早餐專案(CP值超高特色風格民宿)', 114, 60, 3280, '☆專案內容☆\n1. 墾丁优閒民宿四人家庭房含早餐三天兩夜專案*乙間(四人入住)\n2. 早餐4客\n3. 住宿期間免費贈送專屬停車位\n4. *假日每日限量1間，限量間數使用完畢即不再接受專案訂房，敬請儘早訂房。\n\n☆加贈☆熱情的小管家服務'),
(275, '【墾丁禾金豐旅店】雙人買一晚送一晚(平日限量升等四人房)', 115, 60, 2599, '【費用包含】\n1、住宿：主題雙人房-平日住宿1晚(1大床，館別與房間依民宿安排，恕不接受指定)。\n2、餐食：早餐兌換券2張。\n3、設施：客房備品(茶包/礦泉水/沐浴乳/洗髮乳)、電視、獨立空調、WiFi…等(民宿無提供停車位，但附近路邊可停車)。\n\n【贈品】\n◆送-主題雙人房平日住宿1晚(內容與規定皆同主商品。住宿可三天二夜連住或同天開二間房，須一次使用完)。\n◆平日限量升等四人房(2大床)，第3、4人不含早餐券，若升等完以原房型為主。'),
(276, '【高雄遠山望月】★2大2小一泊二食★豪華湯屋狩獵帳', 116, 60, 4599, '【購券後訂房規範，請依飯店告知辦理】\n1.本券包含住一晚豪華湯屋狩獵帳，兩人份早餐、晚餐。【獨家:本券5-9月週日至週五，無須加價使用】\n2.如攜帶小孩12歲以下兩位可加贈自助式早餐，晚餐加量給予。\n3.晚餐為BBQ或火鍋二擇一 (為提倡環保不浪費原則，晚餐足量提供,實際菜色請依現場提供無主)。\n4.園區加贈 日式和服體驗活動 乙份。(園區保有活動變更權力)\n備註:可以現場加購$1000元/人- 冒險探索園區全套設施\n5.園區大眾美人湯溫泉，住宿期間可無限次使用。\n6.園區約5.2公頃，青草樹木，環境幽雅。每房獨立露台或庭院可以用餐。\n7.現場加價$1500入住頂級豪華villa湯屋營車 (2021年3月全新建置)。\n8.豪華狩獵帳整個區域平台，含露台約有15坪。VILLA營車含私人停車位約有25-30坪。\n9.早餐/晚餐的地點與時間：\n早餐為8:00-10:00，防疫期間房客可選擇於餐廳使用或外帶回房間用餐。\n晚餐為17:30-19:00，送至房間內使用。\n10.本券加價規定:\n【5~9月】週六假日+$1000，連續假+$1500，\n【10~12月】平日加$600，週日、週五、連假前一天為旺日加$800，週六假日+$1600，連續假+$2600，\n11.優惠期限至2022年12月30日止，逾期未兌換可至原購買通路辦理退費。'),
(277, '【VIVISPA】美魔女循環緊緻曲線護理130分', 117, 62, 799, '【兌換方式& 規定】\n◎ 是否需預約：\n【使用注意事項】\n◎ 不得與其他優惠合併使用，恕無法兌換現金及找零\n◎ 請持手機簡訊或列印e-mail兌換券到店使用\n◎ 兌換券逾期未使用，可辦理退費。\n以上規範如與兌換券不同，則依兌換券為準。'),
(278, '【悅禾莊園Spa】嚴選★芳療油壓課程-1小時', 118, 62, 1900, '【兌換方式＆規定】\n◆請至少於一週前先行以電話預約，並告知使用Momo憑證，實際預約情況視店家當天預約情況為主\n◆逾時15分鐘視同取消該次預約，敬請配合，恕不接受現場直接預約\n◆平假日皆可使用(春節營業時間將另行公告)，不分男女皆可使用，可指定芳療師，可跨店使用\n◆每張票券限一人使用，恕無法與他人併用\n◆請持手機簡訊或列印email兌換券到店使用，如非本人到店消費，需留親筆簽名，以示消費此兌換券\n◆電子票券逾期未使用，可向momo辦理退費\n◆本賣場票券經使用後即時註銷，任意重製、塗改、影印、複製等違法行為，一經查獲必移送法辦\n◆本公司保留本賣場修改、變更及終止本活動之權利，不得與其他優惠合併使用，恕無法兌換現金及找零'),
(279, '【On-Spa】北部-全程不推銷+不限使用張數「智慧曲雕魔提仙塑」120分鐘', 119, 62, 888, '♛三大保證♛ ✔全程不推銷 ✔不限使用張數 ✔滿時數不重疊 \n1.讓妳輕鬆享受喜歡的課程，不用害怕被推銷，因為這檔『全程不推銷』。\n2.滿意此課程可再回購，不用擔心買過多課程，因為這檔『不限使用張數』。\n3.完整120分鐘課程，不用怕店家流程重疊時間做，因為這檔『滿時數不重疊』。\n\n/課程特色/\n►1次有感！媲美LPG高科技智慧曲雕➟把全身肥肉通通鏟走！\n►完整三大課程『全身完整雕瘦+無死角美白+爆汗岩盤浴』。\n►北部6店任選．板橋、中山、蘆洲、大同區、桃園區一起幫妳雕塑！'),
(280, '【On-Spa】天使魔提智慧曲雕消橘皮 2次共260分鐘', 119, 62, 999, '★１次就有感！高科技智慧曲雕?把全身肥肉通通鏟走！\n\n1.課程前量身檢測\n2.更換專屬天使塑身衣\n3.全身天使魔提智慧曲雕 40分\n4.晶砂巧克力纖體去角質 30分(全身正反面)\n5.頭肩頸手技紓壓按摩 20分\n6.美人爆汗岩盤浴 40分\n\n--單次共130分鐘--每人可享2次=共260分鐘\n部位不用選！全身通通瘦．嫩．白！'),
(281, '天然沐．汗蒸 單人獨享特惠VIP+贈100元汗蒸抵用券', 120, 62, 495, '汗蒸為一種「出汗排毒」的熱療原理\n藉由汗液將體內的有害毒素－乳酸、尿素及氨排出體外\n進而加速身體循環，有效代謝廢物、調節體溫及消耗熱量\n為韓國最夯的全民運動養生法\n\n\n汗蒸為熱療與保健養生\n身體天生就有自我療癒的能力\n只是在緊湊生活中及壓力下難以放鬆\n久未舒解的壓力體內容易累積毒素導致生病\n來到「天然沐汗蒸」進行「心」的療癒\n放鬆身體、放下雜念~讓「心」完完全全靜下來\n放鬆身心靈達到心靜並好好享受大量排汗的舒暢感'),
(282, '【六福村主題遊樂園】(4張組)', 121, 63, 2796, '單張使用說明：\n1.本券得兌換六福村主題遊樂園壹人入場(僅限六福村主題遊樂園使用)，使用時不開立發票。\n2.六福村門票為一票到底,園區內搭乘所有設施,欣賞表演(牛排館、阿拉丁餐廳表演秀除外)及觀看動物均不需另外收費, 但特殊遊樂服務如電玩,動物餵食,猛獸籠車,VR虛擬實境遊戲,狐猴體驗及餐飲商品需另外收費。\n3.本券不適用於中型巴士之團體,亦不得與現場其他優惠專案合併使用。\n4.如因天候不佳或其他不可抗力因素(如台電停電及維修或颱風來襲等),遊樂設施及表演會有暫停或取消可能, ,亦可能全園區閉園,恕不另行通知,詳情請參考六福村官網公告。\n5.本券優惠期限自即日起至2022年12月31日止,本券不分平假日,寒假、過年期間皆可使用。\n6.持券人不得兌換現金及展延優惠期限。\n7.於水樂園開放期間,可於現場加價$200元升等為水陸聯票。\n8.如逾期使用以本券彰顯金額視同現金抵用,得於六福村門票使用,如消費不足折抵時,應現場以現金補足差價。\n9.本券退票須以整組套券全數並檢附購票憑證始得辦理。'),
(283, '【花蓮遠雄海洋公園】海洋之心★雙人全票贈梅格套餐(含焗烤飯x1+飲料x1+泡芙x4)', 122, 63, 1780, '花蓮遠雄海洋公園-----------------------\n距花蓮市中心約30分鐘車程，大致可分為綠野花園、兒童王國、海洋天地、山上機動城、急流天地、雀鳥天堂及集古村七大主題景區，此外還有一個海洋生物展示館是台灣第一座以海洋為主題並結合自然景觀公園、五星級休閒飯店（遠雄悅來大飯店）的主題樂園。除多種遊樂設施，還有各項可愛逗趣的海豚、海獅表演，海底世界花車遊行，加上大型歌舞秀及美人魚表演－保證您值回票價！'),
(284, '【馥森里山】單人午間套餐+DIY體驗活動MO', 123, 63, 1091, '1.票券包含午間套餐一客以及DIY體驗活動一次，(不分平假日)\n使用前至少須於入園日前3天完成預約，票券內容需一次使用完畢，恕無法分次使用\n2.每券適用1位12歲以上旅客參加活動\n3.6-11歲旅客參加活動須現場加購，5歲以下旅客可免費入園(無提供餐食及活動內容 )\n4.兒童現場加購費用說明如下：\n(1)午餐 418元/人\n(2)DIY 250元/人(含材料)\n5.因餐廳座位有限，午餐將依現場狀況安排用餐餐廳。恕無法指定，若有特殊餐飲禁忌請提前告知。\n6.如遇特殊主題專案(如月光海餐酒會)活動期間用餐，須依活動專案說明補足票券價差；特殊主題活動專案資訊，請參照馥森里山官網最新消息公告\n7.園區營業時間：週一~週日9:00-17:00(每週三固定休園)\n8.優惠期限至2022年12月30日止，逾期未兌換可至原購買通路辦理退費。'),
(285, '【新竹北埔】綠世界生態農場門票 4張', 124, 63, 1135, '使用說明：\n◎ 本券限一人使用可憑本券入園。\n◎ 本券不分、平假日皆可使用，假日人潮眾多，請盡量平日前往使用。\n◎ 營業時間及相關使用規則以園區公告為主。\n◎ 本券不分大人小孩均適用，如符合園區優惠價格建議自行前往購買。\n◎ 本券不得轉售，未蓋本公司鋼印者無效。\n◎ 兒童90公分以下，或未滿3歲(憑健保卡)→免費入場\n◎ 年滿3歲/90公分以上兒童；幼稚園/國小/國中學生(憑證件)→半票\n◎ 地址：新竹縣北埔鄉大湖村7鄰20號'),
(286, '【滑人水上俱樂部】水陸歡樂體驗票券-小孩(6歲以下)', 125, 63, 1580, '1.憑本張券小孩(6歲以下)可至滑人水上體驗俱樂部有限公司？換在日月潭體驗SUP立式划槳乙次&租借電動自行車。\n2.週一至週日皆適用。\n3.日出場時間：05:30-07:30、晨間場時間：08:30-10:30、午間場時間：12:00-14:00、下午場時間：14:30-16:30。\n4.本專案內容分別包含體驗立槳和電動自行車時所需全套裝備。\n5.立槳裝備：划板、救生衣、槳、腳繩，基礎立槳教學、教練隨隊伴航、行程解說導覽、航程中跟拍服務和照片提供，划板體驗時間約2小時。\n6.本專案立式划槳體驗活動係指將顧客帶領至合法水域遊憩活動場所\n7.本專案由滑人水上體驗俱樂部提供日月潭立式划板體驗服務\n8.本專案內容包含全套SUP裝備提供、基礎立槳教學、教練隨隊伴航、行程解說導覽、航程中跟拍照片提供\n9.本專案投保200萬意外險與10萬實報實銷醫療保險。\n10.立槳活動需採預約制，無法當天臨時報名參加，如現場要加人加價恕無法受理。\n11.電動自行車則可於營業時間內皆可兌換體驗，週一至週五最晚可租借時間為16:00、週六和週日最晚可租借時間為16:30。(電動自行車裝備：電動車乙輛、安全帽，並投保200萬意外險與10萬實報實銷醫療保險，騎乘體驗時間2小時。)');

